    red: 232,
    green: 80,
    blue: 91,
  },
  sad: {
    red: 232,
    green: 80,
    blue: 91,
  },
  surprised: {
    red: 232,
    green: 80,
    blue: 91,
  },
  annoyed: {
    red: 232,
    green: 80,
    blue: 91,
  },
  feeling: null,
  on: false,
